function getUrlParams(url) {
	var i, params = {},
		q = decodeURIComponent(url),
		si = q.indexOf('?');
	if (si > -1) {
		var parts = q.substring(si + 1, q.length).split("&"),
			temp, m, mn, mi, i = 0, l = parts.length;
		for (; i < l; i++ ) {
			temp = parts[i].split('=');
			m = temp[0].match(/\[\w*\]/g);
			if (m) {
				mn = temp[0].substr(0, temp[0].indexOf('['));
				mi = m[0].substr(1, m[0].length - 2);
				if (!params[mn]) {
					params[mn] = (mi === '' ? [] : {});
				}
				params[mn][(mi === '' ? params[mn].length : mi)] = temp[1];
			} else {
				params[temp[0]] = temp[1];
			}
		}
	}
	return params;
}

function getUrlParameter(name, url) {
    if (!url)
		url = window.location.href;
	
    name = name.replace(/[\[\]]/g, '\\$&');
    let regex = new RegExp('[?&]' + name + '(=([^&#]*)|&|#|$)');
    let results = regex.exec(url);

    if (!results)
		return null;
	
    if (!results[2])
		return '';
	
    return decodeURIComponent(results[2].replace(/\+/g, ' '));
}

