(function(){
	
	let editorInstance;

	const pluginManager = app.desktop.editor.pluginManager = new function() {
		let plugins = [];
		let registry = [];

		this.add = function(name, pluginFn) {
			registry[registry.length] = [name, pluginFn];
		};
		this.get = function(name) {
			for (let i = 0; i < plugins.length; i++) {
				if (plugins[i].name === name)
					return plugins[i];
			}
			return null;
		};
		this.init = function() {
			for (let i = 0; i < registry.length; i++) {
				plugins[i] = registry[i][1]();
				plugins[i].name = registry[i][0];
			}
			registry = null;
		};
	};
	const eventManager = app.desktop.editor.eventManager = new function() {
		constructors.triggers.call(this);
	};
	const selectionUpdate = function(){ eventManager.trigger('selection-update'); };
	
	function MainToolbar() {
		app.desktop.editor.ui.Toolbar.call(this, {
			cls: 'desktop-tools',
			buttons: 'textformat itemcolor textcolor | copy pin unpin maximize minimize lock unlock'
		});

		this.init = function() {
			const el = this.getEl();
			const plugins = ['textformat', 'textcolor', 'itemcolor'];
			for (let i = 0; i < plugins.length; i++) {
				el.append(pluginManager.get(plugins[i]).getToolbar().getEl());
			}

		};

		this.bind('hide', function() {
			eventManager.trigger('collapse-menu');
			let el = editorInstance.getContentEl();
			if (!el)
				return;
			el.unbind('click keyup', selectionUpdate);
		});

		eventManager.bind('item-select', function(item) {
			editorInstance.getContentEl().bind('click keyup', selectionUpdate);
		});
	};
	
	app.desktop.Editor = function() {

		editorInstance = this;
		
		this.ui = {};

		this.selection = new function() {
			const sel = window.getSelection();
			let range;
			this.select = function() {};
		};

		this.getItem = function() { return App.getDesktop().getSelected(); };
		this.getContentEl = function() {
			let item = this.getItem();
			return item ? item.getContentEl() : null;
		};
		this.renderTo = function(el) {
			this.toolbar.renderTo(el);
		};
		this.trigger = function(){
			eventManager.trigger.apply(this, arguments);
		};
		this.init = function() {
			this.toolbar = new MainToolbar();
			pluginManager.init();
			
			eventManager.bind('item-select', function(item) {
				let el = editorInstance.toolbar.getEl();

				editorInstance.toolbar.show();

				let flag = false;
				el.find('>div').each(function(){
					const d = $(this);
					if (d.is('div.separator')) {
						d[flag ? 'show' : 'hide']();
						flag = false;
					} else if (d.is('div.btn') && !d.is(':hidden'))
						flag = true;
				});

				let offset = item.getEl().position();
				if (offset.left > 400)
					offset.left -= el.outerWidth() + 4;
				else
					offset.left += item.getEl().outerWidth() + 5;
					
				el.css({left: offset.left, top: offset.top});
			});
			
		};
		this.hide = function() {
			this.toolbar.hide();
		};
		this.execCommand = function(command, param) {
			this.getContentEl().focus();
			switch (command) {
				case 'insertContent':
					let item = this.getItem();
					let data = {content: param};
					//desktop.util.content.prepare(data);
					let el = $(data.content);
					//this.trigger('beforeSetContent', data);
					
					let sel = window.getSelection();
					let range = sel.getRangeAt(0);
					range.collapse(true);
					range.insertNode(el[0]);
					range.setStartAfter(el[0]);
					range.collapse(true);
					sel.removeAllRanges();
					sel.addRange(range);
					item.getContentEl().trigger('input');
					break;
			}
			//document.execCommand(command, false, param);
		};

		//this.
	};
})();
